import React from "react";
import ReactDOM from "react-dom";
import Card from "./Card";
import Sdata from "./sdata";

//console.log(Sdata[0].sname) ;
    



ReactDOM.render(
    <div>

    <h1>List of top 5 Netflix in 2020</h1>
    <Card imgsrc ={Sdata[0].imgsrc}
        title =  {Sdata[0].title}
        sname ={Sdata[0].sname}
        link ={Sdata[0].link}
    />

<Card imgsrc ="https://wallpapercave.com/wp/wp4056410.jpg"
        title = " A Netflix original Series "
        sname ="EXTRACURRICULAR"
        link ="https://www.netflix.com/in/title/80990668?source=35"
    />
    

    <Card imgsrc ="https://wallpapercave.com/wp/wp1917154.jpg"
        title = " A Netflix original Series "
        sname ="STRANGE THINGS"
        link ="https://www.netflix.com/in/title/80990668?source=35"
    />
    
    
    </div>,
    document.getElementById('root')
    );
